import logo from './Holberton_logo.jpg' ;
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='App-header' >
        <img src={logo} className="App-logo" alt='logo' />
        <h1>School dashboard</h1>
      </div>
      <div className='App-body' ></div>



    </div>
  );
}

export default App;
